import React, { Component } from 'react';
import './App.css';
import Home from './containers/Home'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
    	<Router>
    		<Switch>
    		<Route path="/">
	    		<Home/>
	    	</Route>
	    	</Switch>
    	</Router>
    )
  }
}

export default App;
